ALTER TABLE RH_BILLING
	DROP PRIMARY KEY CASCADE;
DROP TABLE RH_BILLING CASCADE CONSTRAINTS;

CREATE TABLE RH_BILLING
(
	RH_BILL_ID VARCHAR2(10 BYTE),
	RH_PATIENT_NO VARCHAR2(10 BYTE),
	RH_BILL_NO VARCHAR2(50 BYTE),
	RH_BILL_DATE DATE DEFAULT SYSDATE,
	RH_THERAPIST_NAME VARCHAR2(50 BYTE),
	RH_STAFF_ID VARCHAR2(10 BYTE) NULL,
	RH_BILL_AMOUNT NUMBER,
	RH_CREATED_DATE DATE DEFAULT SYSDATE,
	RH_CREATED_USER VARCHAR2(30) DEFAULT 'SYSTEM',
	RH_MODIFIED_DATE DATE DEFAULT SYSDATE,
	RH_MODIFIED_USER VARCHAR2(30) DEFAULT 'SYSTEM',
	RH_ENABLED NUMBER(*,0) DEFAULT 1,
	PRIMARY KEY (RH_BILL_ID)
);

CREATE INDEX RH_BILLING_IDX1
ON RH_BILLING(RH_PATIENT_NO);

CREATE INDEX RH_BILLING_IDX2
ON RH_BILLING(RH_BILL_DATE);

